import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import FitnessCenterIcon from '@mui/icons-material/FitnessCenter';
import { Link, useNavigate } from 'react-router-dom';



export default function Navbar() {

  const navigate = useNavigate();


  return (
    <Box sx={{
                width: '100%' }}>
      <AppBar position="fixed">
        <Toolbar sx={{ backgroundColor: 'primary.main' }}>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            onClick={() => navigate('/')}>
              <FitnessCenterIcon />
            </IconButton>
            <Typography sx={{ flexGrow: 1, fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '2em', cursor: 'default'}}>
              GYMBRO
            </Typography>
            <div className='navLinkContainer'>
              <div>
                <Link to={"/MyRoutines"} className='navLink' variant='linkNavbar'>MY ROUTINES</Link>
              </div>
              <div>
                <Link to={"/MyRoutines"} className='navLink'>LOGIN</Link>
              </div>
              <div>
                <Link to={"/MyRoutines"} className='navLink'>SIGN UP</Link>
              </div>
            </div>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
